import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from 'react-router-dom'

import App from "./App";
import FirebaseProvider from "./components/FIrebaseContext";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <FirebaseProvider>
  <BrowserRouter>
  <App />
  </BrowserRouter>
  </FirebaseProvider>
 ,
  rootElement


);
